/**
*   access_token: str
*   token_type: str
*   expires_in: int
**/
var auth=null;
/**
* Currently just toss into global var.  Token only good for 1hr.
* TODO: Secure token and save to local store.
* Derived from 'SendPulse' JS API: https://github.com/sendpulse/sendpulse-rest-api-node.js/blob/master/api/sendpulse.js
*/
function saveAuthToken(authResp){
  auth = authResp;
}

function sendPOST(path, data, callback){
  var xhr = new XMLHttpRequest();
  var url = "https://api.sendpulse.com:443/"+path;
  if(auth){
    url = "https://api.sendpulse.com:443/"+path;
  }
  xhr.open("POST", url, true);
  xhr.setRequestHeader("Content-type", "application/json");

  if(auth){
    var token = auth.token_type+" "+auth.access_token;
    console.log("adding token: "+token);
    xhr.setRequestHeader("Authorization", token);
  }
  xhr.onreadystatechange = function () {
      if (xhr.readyState === 4 && xhr.status === 200) {
        var resp = JSON.parse(xhr.responseText);
        console.log("response: ",JSON.stringify(resp));
        if(callback){
          callback(resp);
        }
      }else{
        console.log("xhr.readyState: " +xhr.readyState+ " xhr.status:"+xhr.status);
        if(xhr.readyState === 4){
          console.log("xhr: ",xhr);
        }
      }
  };
  console.log("Posting data: ",JSON.stringify(data));
  xhr.send( JSON.stringify(data) );
}

function getAuth(callback){
  sendPOST("oauth/access_token", sendPulse_Cred,
    function(resp){
      saveAuthToken(resp);
      if(callback){
        callback();
      }
  });
}

